import React from "react";


const Card = (props) => {
    return (
     <div className="bg-light-yellow">
     	<img alt="robots" src="https://robohash.org/${props.id}?set=set4" />
     	<div>
     		<h2>{props.name}</h2>
     		<p>{props.id}</p>
     	</div>
     </div>
	)
}

export default Card;
